import {React, Component} from "react"

class Main extends Component{
    constructor(props){
        super(props)

        this.state = {
            searchName: ""
        }
    }

    render(){
        return(
            <input type='text' value={this.state.searchName} placeholder='Search by song name'/>

        );
    }
}

export default Main;
